        "name": "finalizePackageDescription",
        "normalized": "FlagAssignment-\u003e(Dependency-\u003eBool)-\u003ePlatform-\u003eCompilerId-\u003e[Dependency]-\u003eGenericPackageDescription-\u003eEither[Dependency](PackageDescription,FlagAssignment)",
