        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eThis manages everything to do with where files get installed (though does\n not get involved with actually doing any installation). It provides an\n \u003ccode\u003e\u003ca\u003eInstallDirs\u003c/a\u003e\u003c/code\u003e type which is a set of directories for where to install\n things. It also handles the fact that we use templates in these install\n dirs. For example most install dirs are relative to some \u003ccode\u003e$prefix\u003c/code\u003e and by\n changing the prefix all other dirs still end up changed appropriately. So it\n provides a \u003ccode\u003e\u003ca\u003ePathTemplate\u003c/a\u003e\u003c/code\u003e type and functions for substituting for these\n templates.\n\u003c/p\u003e\u003c/div\u003e",
        "fct-module": "Distribution.Simple.InstallDirs",
