        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eThis handles the \u003ccode\u003esdist\u003c/code\u003e command. The module exports an \u003ccode\u003e\u003ca\u003esdist\u003c/a\u003e\u003c/code\u003e action but\n also some of the phases that make it up so that other tools can use just the\n bits they need. In particular the preparation of the tree of files to go\n into the source tarball is separated from actually building the source\n tarball.\n\u003c/p\u003e\u003cp\u003eThe \u003ccode\u003e\u003ca\u003ecreateArchive\u003c/a\u003e\u003c/code\u003e action uses the external \u003ccode\u003etar\u003c/code\u003e program and assumes that\n it accepts the \u003ccode\u003e-z\u003c/code\u003e flag. Neither of these assumptions are valid on Windows.\n The \u003ccode\u003e\u003ca\u003esdist\u003c/a\u003e\u003c/code\u003e action now also does some distribution QA checks.\n\u003c/p\u003e\u003c/div\u003e",
